function PayRent(){
    const [post, setPosts ] = useState ([]);

    const url = "https://sandbox.payfast.co.za/eng/process?merchant_id=10018036&merchant_key=v113p2nf34wqz&return_url=https%3A%2F%2F6d6a14b0.ngrok.io%2Fhome%2Freturn&email_address=sbtu01%40payfast.co.za&m_payment_id=8d00bf49-e979-4004-228c-08d452b86380&amount=30&item_name=Once+off+option&item_description=Some+details+about+the+once+off+payment&email_confirmation=1&confirmation_address=sbtu01%40payfast.co.za&signature=eb63a826f61c5adb1b35b0b0b3c2b4a6";
    const url2 = "https://facebook.com";
   

        useEffect(() => {
            axios.post(url)
              .then(response => {
                setPosts(response.data);
                console.log(response.data);
              })
              .catch(error => {
                console.error(error);
              });
          }, []);  
          
          //Previous Rentals for all tenants

    const [ allRentals, setAllRentals ] = useState([]);
    
    const urlRentals = "https://localhost:44311/api/controller/GetAllRents";
    useEffect( () => {

        /*include code to check if this admin or a normal user 
        * if user pass the user name to the url
        */
        axios.get(urlRentals)
        .then(response =>{
            setAllRentals(response.data);
            console.log(response.data)
        })
        .catch(error =>{
            console.error(error);
        });
    },[]);

    //Modal to handle showing previous rental payments for a single tenant
    const [ show, setShow ] = useState(false);

    const handleClose = () => setShow(false); 
    
    const [ userRent, setUserRent ] = useState([]);
    
    function HandleShow (ProfileId){
        setShow(true);
        const userRentUrl = "https://localhost:44311/api/controller/GetUserRent?ProfileId="+ProfileId;

        return userRentUrl;
    }  

    const uRentUrl = userRentUrl;

        

        useEffect(() => {
            axios.get(uRentUrl)
                .then(response => {
                    setUserRent(response.data);
                    console.log(response.data);
                })
                .catch(error =>{
                    console.log(error);
                });
        },[]);
  
       
    
    return(
        <div className="container">
            <div className="row">
                <h4> Pay Rent Now </h4>
            </div>
            <div className="row payRentDetails">
                <div class="col-6 personalRentDetails">
                    <p> Dear: </p>
                    <p> Rental due this month is : </p>
                    <button type="button" class="btn btn-primary paymentBtn"> Pay Now </button>
                </div>
                <div class="col-6 paymentOptions">
                <p> Supported payment methods </p>
                    <div className="paymentOptions">
                        <img class="paymentImages" src={logo} alt="Logo" height={100} width={100} />
                        <img class="paymentImages" src={logo} alt="Logo" height={100} width={100} />
                    </div>
                </div>                
            </div>
            <div className="row">
                        <p> You will be redirected to a  payment window where you can chose</p>
            </div>

            <div className="row">
                <div className="previousRentals">
                    <h4> Previous Rental Statements </h4>
                    <table class="table table-striped">
                        <thead class="thead-dark">
                            <tr>
                                <th> Rent Id </th>
                                <th> Profile Id</th>
                                <th> Unit No </th>
                                <th> Due Date </th>
                                <th> Payment Date </th>
                                <th> Rent Price </th>
                                <th> Action </th>
                            </tr>
                        </thead>
                        <tbody>
                        {
                            allRentals.map((rent, index) => {
                                return <tr key={index}>
                                    <td>{rent.rentId}</td>
                                    <td>{rent.profileId}</td>
                                    <td>{rent.unitNo}</td>
                                    <td>{rent.dueDate}</td>
                                    <td>{rent.paymentDate}</td>
                                    <td>{rent.rentPrice}</td>
                                    <td>
                                        <Button 
                                            variant="btn btn-primary"
                                            onClick={() => HandleShow(rent.ProfileId)}>
                                            View Previous Rental Payments
                                        </Button>
                                        <Modal
                                            show={show}
                                            handle={handleClose}
                                            backdrop="static"
                                            size="lg"
                                            aria-labelledby="contained-modal-title-vcenter"
                                            centered
                                            keyboard={false}
                                        >
                                        <ModalHeader closeButton>
                                            <Modal.Title> 
                                                Smart Living Rental Property Terms and Conditions 
                                            </Modal.Title>
                                        </ModalHeader>
                                        <Modal.Body>
                                        <table class="table table-striped">
                                            <thead class="thead-dark">
                                                <tr>
                                                    <th> Rent Id </th>
                                                    <th> Profile Id</th>
                                                    <th> Unit No </th>
                                                    <th> Due Date </th>
                                                    <th> Payment Date </th>
                                                    <th> Rent Price </th>
                                                    <th> Action </th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                {
                                                    userRent.map((userRental, index) => {
                                                        return <tr key={index}>
                                                            <td>{userRental.unitNo}</td>

                                                        </tr>
                                                    })
                                                }
                                                <tr>
                                                    <td></td>
                                                    <td></td>
                                                    <td></td>
                                                    <td></td>
                                                    <td></td>
                                                    <td>
                                                        <button className="btn btn-primary">
                                                            Simple Button
                                                        </button>
                                                    </td>
                                                </tr>
                                                
                                            </tbody>
                                        </table>
                                        </Modal.Body>

                                        </Modal>
                                    </td>
                                </tr>
                            })
                        }
                        </tbody>
                    </table>

                    <div className="paymentOptions">
                        <img></img>
                    </div>

                    
                </div>
                             

            </div>
        </div>
    )
}

export default PayRent;
